import {data} from '../data'
import axios from 'axios';

class articlelist extends Component {
    
    constructor(){
        super()
        this.state = {
            articles: [1,2,3,4]
        }
    }
    
    componentDidMount(){
        console.log(this.state.articles)
    }
    
    render(){
 
        return(
            <React.Fragment>
                <div>
                    {this.state.articles.map((value,index))
                    }
                </div>
            </React.Fragment>
            
        )
    }
}

                                
export default articlelist;
